INSERT INTO `shoes` VALUES (1,'Nike Dunk Low Retro','nike-dunk-low-retro','01JXHFSJZPP6T26PENHF5GJJ9N.avif','You can always count on a classic. The Dunk Low pairs its iconic colour-blocking with premium materials and plush padding for game-changing comfort that lasts. The possibilities are endlesshow will you wear your Dunks?\n\nColour Shown: Photon Dust/Smoke Grey/Sail/Denim Turquoise\nStyle: HF5441-001\nCountry/Region of Origin: China',1549000,5,1,4,1,NULL,'2025-06-12 00:13:43','2025-06-12 00:13:43'),(2,'Nike Downshifter 13','nike-downshifter-13','01JXHG4CPW6HQMN27S2Q3K07FP.png','Whether you\'re starting your running journey or an expert eager to switch up your pace, the Downshifter 13 is down for the ride. With breathable mesh and an updated internal fit band, it helps you find that extra gear or take that first stride towards chasing down your goals.\n\nColour Shown: Laser Orange/Apricot Agate/Pale Ivory/Black\nStyle: FD6454-800\nCountry/Region of Origin: Indonesia',899000,5,1,2,1,NULL,'2025-06-12 00:19:37','2025-06-12 00:19:37'),(3,'Nike Offcourt','nike-offcourt','01JXHGAYTY7NNFQM2S66CV3CJB.png','These slides are designed to help you relax and recharge. Innovative dual-layered foam underfoot pairs with a plush strap to bring the comfort, while the iconic AF-1 pivot circle pattern on the outsole and block-letter branding casually nod to heritage hoops. What are you waiting for? Get lounging.\n\nColour Shown: Anthracite/Black/Black\nStyle: BQ4639-003\nCountry/Region of Origin: Vietnam\n',529000,5,1,3,1,NULL,'2025-06-12 00:23:13','2025-06-12 00:23:13'),(4,'SAMBA JANE SHOES','samba-jane-shoes','01JXKNBJ134FAHJWYQ5JYB7J6Q.png','THE CLASSIC SAMBA SHOES, REIMAGINED AS MARY JANES.\n\nThe adidas Samba shoes get a modern makeover, blending into a trendy Mary Jane aesthetic. With a smooth leather upper and signature serrated 3-Stripes, these low-profile shoes offer a fresh take on a heritage style. The smooth satin lining gives the shoes a luxe feel, and a grippy gum rubber outsole keeps the look classic. From indoor trainer to streetwear staple, the Samba\'s legacy continues to grow.',2500000,5,1,1,3,NULL,'2025-06-12 20:29:24','2025-06-12 20:29:24'),(5,'RESPONSE CL SHOES','response-cl-shoes','01JXKNVDJ5XMRF0FGK9DMXZ9EQ.png','BOLD SHOES MADE IN PART WITH RECYCLED MATERIALS.\n\nInspired by the adidas 2000s Response series, these retro-styled shoes bring back the sporty and chunky looks of the era. Multiple overlays and details give these trainers a premium feel and showcase adidas design heritage. A mesh upper and EVA midsole deliver breathability and cushioning, while the rubber outsole offers durable traction. Slip these on and tap into nostalgia.   This product features at least 20% recycled materials. By reusing materials that have already been created, we help to reduce waste and our reliance on finite resources and reduce the footprint of the products we make.',3000000,5,1,4,3,NULL,'2025-06-12 20:38:04','2025-06-12 20:38:04'),(6,'CRAZY 2.0 SHOES','crazy-20-shoes','01JXKP6DEJBCC7M6WXDB4H2QGE.png','AN ICONIC SILHOUETTE WITH A SMOOTH, TECHNICAL VIBE.\n\nA bring-back of a legendary adidas basketball shoe, these mid top trainers are retooled for the street. They feature a sleek and striking moulded synthetic leather upper. The midsole combines ultralight Lightstrike cushioning in the forefoot and Lightstrike Pro in the heel. The iconic Torsion System adds midfoot support for all-day comfort.',3899000,5,1,1,3,NULL,'2025-06-12 20:44:04','2025-06-12 20:44:04'),(7,'PUMA x HARRY POTTER Palermo','puma-x-harry-potter-palermo','01JXKPKASQAA2DQPN6YDF41BKT.png','Add some magic to your look with PUMA x HARRY POTTER. This new collab is a mashup of Quidditch and football aesthetics, reinterpreting Gryffindor and Slytherin team uniform...',2799999,5,1,1,2,NULL,'2025-06-12 20:51:07','2025-06-12 20:51:07'),(8,'PUMA x HARRY POTTER Easy Rider Sneakers Youth','puma-x-harry-potter-easy-rider-sneakers-youth','01JXKPXPMC3N1FBT192FEFBFQA.png','Add some ma